import React from "react";
import classes from "./AnimationPage.module.css";
import { motion } from "framer-motion";

const AnimationPage = () => {
  return (
    <div className={classes.animate}>
      <h2>Hello</h2>
      <motion.div></motion.div>
    </div>
  );
};

export default AnimationPage;
